    "category": "source"
  },
  {
    "path": "src/id_system.py",
    "description": "Core ID system and mismatch-checking library that defines canonical ID construction, loads extraction/annotation/prereg inputs, validates cross-link integrity, and produces structured mismatch findings plus report text.",
    "category": "source"
  },
  {
    "path": "src/io_formats.py",
    "description": "Input/output helpers for reading extraction CSV/TSV rows, taxonomy annotations in JSONL, and prereg fields in JSON/CSV while preserving stable identifiers and emitting normalized records for checking.",
    "category": "source"
  },
  {
    "path": "runtime/fixtures/demo_extraction.csv",
    "description": "Example extraction table fixture containing a small set of rows with stable keys used to demonstrate ID linking and mismatch detection.",
    "category": "support"
  },
  {
    "path": "runtime/fixtures/demo_taxonomy.jsonl",
    "description": "Example taxonomy-annotation JSONL fixture referencing extraction-row IDs with at least one intentionally incorrect or missing ID to trigger the mismatch checker.",
    "category": "support"
  },
  {
    "path": "runtime/fixtures/demo_prereg_fields.json",
    "description": "Example preregistration fields fixture mapping prereg field IDs to extraction-row IDs with an intentional mismatch to demonstrate cross-source linking validation.",
    "category": "support"
  },
  {
    "path": "README_id_mismatch_demo.md",
    "description": "Documentation explaining the ID scheme, file formats, how the checker works, and how to run the demo to generate the human-readable report under runtime/outputs/_build/.",
    "category": "documentation"
  }
]

